//SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.6.12;
import "@openzeppelin/contracts/math/SafeMath.sol";
import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/access/AccessControl.sol";
import "@openzeppelin/contracts/proxy/Initializable.sol";
import "./SafeMath32.sol";
import "./SafeMath8.sol";

contract FWarChar is 
    ERC721("FwarChar", "FWC"),
    Initializable,
    AccessControl
{
    using SafeMath for uint256;
    using SafeMath32 for uint32;
    using SafeMath8 for uint8;

    event MintNFT(address receiver, uint32 indexed tokenId, uint8 level, uint8 indexed rarity, uint8 indexed elementType, uint32 teamId, uint32 attack, uint32 defense, uint32 health);
    event UpgradeNFT(uint32 indexed tokenId, uint8 level, uint32 attack, uint32 defense, uint32 health);
    struct CharInfo {
        uint8 level;

        uint8 rarity;

        uint8 elementType;

        uint32 teamId;

        uint32 baseAttack;
        uint32 baseDefense;
        uint32 baseHealth;

        uint32 attack;
        uint32 defense;
        uint32 health;
    }

    // tokenId => CharInfo
    mapping(uint => CharInfo) public charInfos;

    // level => category => item => tokenURI
    mapping(uint => mapping(uint => mapping(uint => string))) public nftURI;

    bytes32 public constant MINTER_ROLE = keccak256("MINTER_ROLE");
    bytes32 public constant UPGRADATOR_ROLE = keccak256("UPGRADATOR_ROLE");
    bytes32 public constant TRANSFER_ROLE = keccak256("TRANSFER_ROLE");

    function initialize(address admin) public payable initializer {
        _setupRole(DEFAULT_ADMIN_ROLE, admin);
        _setRoleAdmin(MINTER_ROLE, DEFAULT_ADMIN_ROLE);
        _setRoleAdmin(UPGRADATOR_ROLE, DEFAULT_ADMIN_ROLE);
        _setRoleAdmin(TRANSFER_ROLE, DEFAULT_ADMIN_ROLE);
    }

    /// @dev getCharInfo is called by a user
    /// @param _id is the NFT Id 
    function getCharInfo(uint32 _id) external view returns (uint8 level, uint8 rarity, uint8 elementType, 
        uint32 teamId, uint32 attack, uint32 defense, uint32 health) 
    {
        CharInfo memory charInfo = charInfos[_id];
        return (charInfo.level, charInfo.rarity, charInfo.elementType, charInfo.teamId, charInfo.attack, charInfo.defense, charInfo.health);
    }

    /// @dev getCharFullInfo is called by a user
    /// @param _id is the NFT Id 
    function getCharFullInfo(uint _id) external view returns (uint8 level, uint8 rarity, uint8 elementType, 
        uint32 teamId, uint32 baseAttack, uint32 baseDefense, 
        uint32 baseHealth, uint32 attack, uint32 defense, uint32 health) 
    {
        CharInfo memory charInfo = charInfos[_id];
        return (charInfo.level, charInfo.rarity, charInfo.elementType, charInfo.teamId, charInfo.baseAttack, charInfo.baseDefense,
         charInfo.baseHealth, charInfo.attack, charInfo.defense, charInfo.health);
    }

    /// @dev getCharBaseInfo is called by a user
    /// @param _id is the NFT Id 
    function getCharBaseInfo(uint32 _id) external view returns (uint32 baseAttack, uint32 baseDefense, uint32 baseHealth) 
    {
        CharInfo memory charInfo = charInfos[_id];
        return (charInfo.baseAttack, charInfo.baseDefense, charInfo.baseHealth);
    }


    //mint NFT
    function mint(
        address _receiver, 
        uint32 _id,
        uint8 _level,
        uint8 _rarity,
        uint8 _elementType,
        uint32 _teamId,
        uint32 _attack,
        uint32 _defense,
        uint32 _health
    ) external {
        _safeMint(_receiver, _id);
        charInfos[_id].level = _level;
        charInfos[_id].rarity = _rarity;
        charInfos[_id].elementType = _elementType;
        charInfos[_id].teamId = _teamId;

        charInfos[_id].baseAttack = _attack;
        charInfos[_id].baseDefense = _defense;
        charInfos[_id].baseHealth = _health;

        charInfos[_id].attack = _attack;
        charInfos[_id].defense = _defense;
        charInfos[_id].health = _health;

        emit MintNFT(_receiver, _id, _level, _rarity, _elementType, _teamId, _attack, _defense, _health);
    }


    //burn NFT
    function burn(uint32 _tokenId) external {
        require(_isApprovedOrOwner(_msgSender(), _tokenId), "FWC: transfer caller is not owner nor approved");
        _burn(_tokenId);
    }

    //upgrade NFT
    function upgrade(
        uint32 _id,
        uint8 _level,
        uint32 _attack,
        uint32 _defense,
        uint32 _health
    ) external {
        require(hasRole(UPGRADATOR_ROLE, _msgSender()), 'FWC: Upgrade role is required!');

        charInfos[_id].level = _level;
        charInfos[_id].attack = _attack;
        charInfos[_id].defense = _defense;
        charInfos[_id].health = _health;

        emit UpgradeNFT(_id, _level, _attack, _defense, _health);
    }

    function _beforeTokenTransfer(address from, address to, uint256 tokenId) internal virtual override{
        if(from == address(0))
        {
            require(hasRole(MINTER_ROLE, _msgSender()), 'FWC: Minter role is required!');
        }
        else if(to != address(0))
        {
            require(hasRole(TRANSFER_ROLE, _msgSender()), 'FWC: Transfer role is required!');
        }
    }

}
